            <li className="nav-item">
                <Link to="/home" className="nav-link active">
                    Home
        </Link>
            </li>
            <li className="nav-item">
                <Link
                    to="/about"
                    className="nav-link active">
                    About
        </Link>
            </li>
            <li className="nav-item">
                <Link
                    to="/portfolio"
                    className="nav-link active">
                    Portfolio
        </Link>
            </li>
            <li className="nav-item">
                <Link
                    to="/contact"
                    className="nav-link active">
                    Contact
        </Link>
            </li>
        </ul>
            </Nav>
        </Navbar>

    );
}

export default NavTabs;

